function App() {
  const { token, setToken } = useToken();

  return (
    <div className="App">
      <Router>
        <div className="App">
          <Header token={removeToken} />

          <Routes>
            <Route
              exact
              path="/Sentiment"
              element={<Sentiment token={token} setToken={setToken} />}
            />
          </Routes>
        </div>
      </Router>
    </div>
  );
}
